import React, { useState } from "react";
import { Grid, TextField, Button, Card, CardContent } from "@mui/material";
import ToggleOnIcon from "@mui/icons-material/ToggleOn";
import ToggleOffIcon from "@mui/icons-material/ToggleOff";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";

import "./common.css";

export const Home = () => {
  const navigate = useNavigate();
  const [isToggled, setIsToggled] = useState(false);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [errors, setErrors] = useState({ username: "", password: "" });

  const handleToggle = () => {
    setIsToggled(!isToggled);
  };

  const validate = () => {
    let tempErrors = { username: "", password: "" };
    if (!username) tempErrors.username = "Username is required.";
    if (!password) tempErrors.password = "Password is required.";
    setErrors(tempErrors);
    return Object.values(tempErrors).every((x) => x === "");
  };

  const handleClick = (event) => {
    event.preventDefault();
    if (validate()) {
      navigate("/login");
    }
  };

  return (
    <Grid container className="login-container" style={{ minHeight: "100vh" }}>
      <Grid item xs={12}>
        <img src="bot.jpg" alt="" className="photo" />
      </Grid>
      <Grid
        container
        justifyContent="center"
        alignItems="center"
        className="form-container"
      >
        <Grid item xs={12} sm={6} md={4} lg={3.5}>
          <motion.div
            initial={{ opacity: 0, y: -50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
          >
            <Card
              style={{
                borderRadius: "50px",
                boxShadow: "0 4px 8px rgba(0, 0, 0, 0.2)",
              }}
            >
              <CardContent>
                <h1>
                  Medi <span style={{ color: "green" }}>Pharma</span>
                </h1>
                <p style={{ marginLeft: "20px" }}>Login To Continue</p>
                <form>
                  <TextField
                    label="Username"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    value={username}
                    onChange={(e) => setUsername(e.target.value)}
                    error={!!errors.username}
                    helperText={errors.username}
                    sx={{
                      borderRadius: "80px",
                      "& .MuiOutlinedInput-root": { borderRadius: "80px" },
                    }}
                  />
                  <TextField
                    label="Password"
                    type="password"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    error={!!errors.password}
                    helperText={errors.password}
                    sx={{
                      borderRadius: "80px",
                      "& .MuiOutlinedInput-root": { borderRadius: "80px" },
                    }}
                  />
                  <div
                    onClick={handleToggle}
                    style={{
                      display: "flex",
                      margin: "20px 0",
                      cursor: "pointer",
                    }}
                  >
                    {isToggled ? (
                      <motion.div
                        initial={{ rotate: 0 }}
                        animate={{ rotate: 360 }}
                        transition={{ duration: 0.5 }}
                      >
                        <ToggleOnIcon
                          style={{ fontSize: 50, color: "#538eed" }}
                        />
                      </motion.div>
                    ) : (
                      <motion.div
                        initial={{ rotate: 0 }}
                        animate={{ rotate: -360 }}
                        transition={{ duration: 0.5 }}
                      >
                        <ToggleOffIcon
                          style={{ fontSize: 50, color: "gray" }}
                        />
                      </motion.div>
                    )}
                    <span
                      style={{
                        position: "relative",
                        top: "-2px",
                        right: "-10px",
                      }}
                    >
                      <p style={{ cursor: "pointer" }}> Remember Me</p>
                    </span>
                  </div>
                  <motion.div
                    whileHover={{ scale: 1.1 }}
                    whileTap={{ scale: 0.9 }}
                  >
                    <Button
                      onClick={handleClick}
                      variant="contained"
                      color="success"
                      fullWidth
                      style={{ borderRadius: "50px" }}
                    >
                      Login
                    </Button>
                  </motion.div>
                  <br />
                  <br />
                  <center>
                    _________<span style={{ color: "gray" }}> Powered By</span>{" "}
                    MediPharma________
                  </center>
                </form>
              </CardContent>
            </Card>
          </motion.div>
        </Grid>
      </Grid>
    </Grid>
  );
};
